import styled from 'styled-components'

import Doughnut from './Doughnut'
import Alarms from './Alarms'

const Container = styled.div`
  display: flex;
  margin-top: 5rem;
  justify
  align-items: center;
`

const DoughnutAlarms = props => (
  <Container>
    <Doughnut />
    <Alarms />
  </Container>
)

export default DoughnutAlarms
